import { Box, Container, Typography } from "@material-ui/core";
import React from "react";

const AdminUser = () => {
  return (
    <div>
      <Container maxWidth="md">
        <Box component="div">
          <Typography className={styles.title}>Admin Panel</Typography>
        </Box>
      </Container>
    </div>
  );
};

export default AdminUser;
